import React, { useState } from "react";
import './Navbar.css';
import logo from '../Assets/logo.png';    // Change the Project Logo
import cart_icon from '../Assets/cart_icon.png';
import { Link } from "react-router-dom";


const Navbar = () => {

    const [menu,setMenu] = useState("shop");

  return (
    <div className="navbar">
        <div className="nav-logo">
            {/* Add the Project Logo here */}
            <img src={logo} alt=""/>  
        <p>Agriculter Portal</p>

        </div>
        <ul className="nav-menu">
            <li onClick={() => {setMenu("shop")}}><Link style={{textDecoration:'none'}} to='/'/>Shop{menu === "shop"?<hr/>:<></>}</li>
            <li onClick={() => {setMenu("Fatilizer")}}> <Link style={{textDecoration:'none'}} to='/Fatilizer'/>Fatilizer{menu === "Fatilizer"?<hr/>:<></>}</li>
            <li onClick={() => {setMenu("Vegetables")}}><Link style={{textDecoration:'none'}} to='/Vegetables'/>Vegetables{menu === "Vegetables"?<hr/>:<></>}</li>
            <li onClick={() => {setMenu("Fruits")}}> <Link style={{textDecoration:'none'}} to='/Fruits'/>Fruits{menu === "Fruits"?<hr/>:<></>}</li>
        </ul>
        <div className="nav-login-cart">
          <Link to='/login'><button>Login</button></Link>
          <Link to='/Cart'> <img src={cart_icon} alt=""/></Link>
            <div className="nav-cart-count">0</div>
        </div>
    </div>

  )
}

export default Navbar
